import React from 'react';
import '../styles/navbar.css';
import logo from '../images/logo-large.png';
import { NavLink } from 'react-router-dom';

// Custom Navbar Link Component
const NavbarLink = ({ label, href, onClick }) => {
  return (
    <div className="navbar-link" onClick={onClick}>
      <NavLink to={href}>
        {label}
        <div className="underline" />
      </NavLink>
    </div>
  );
};

const Navbar = () => {
  return (
    <nav className="navbar">
      <img src={logo} alt="Logo" className="logo" />
      <div className="desktopMenu">
        <NavbarLink to="/" className="desktopMenuListItem">
          Home
        </NavbarLink>
        <NavbarLink to="/experience" className="desktopMenuListItem">
          Experience
        </NavbarLink>
        <NavbarLink to="/projects" className="desktopMenuListItem">
          Projects
        </NavbarLink>
      </div>
      <button className="desktopMenuBtn">
        <img src="" alt="" className="desktopMenuImg" />
        Resume
      </button>
    </nav>
  );
};

export default Navbar;
